import 'regenerator-runtime/runtime';
import { playSound, userLog, leaveRoom, getId, getSl } from './script';
const peerLoockupUrl = 'https://extreme-ip-lookup.com/json/';
//const notifyBySound = true; // turn on - off sound notifications
const isWebRTCSupported = DetectRTC.isWebRTCSupported;
const isMobileDevice = DetectRTC.isMobileDevice;
const myChatAvatar = '/images/programmer.svg';
const friendChatAvatar = '/images/friend.svg';

let startTime;
let elapsedTime;
let signalingServerPort = 3080; // must be same of server PORT
let signalingServer = getServerUrl();
let roomId = getRoomId();
let peerInfo = getPeerInfo();
let peerGeo = null;
let peerConnection = null;
let myPeerName = null;
let useAudio = true;
let useVideo = true;
let camera = 'user';
let isScreenStreaming = false;
let isChatRoomVisible = false;
let isChatEmojiVisible = false;
let isAudioVideoDevicesVisible = false;
let isVideoOnFullScreen = false;
let isDocumentOnFullScreen = false;
let signalingSocket = null; // socket.io connection to our webserver
let localMediaStream = null; // my microphone / webcam
let remoteMediaStream = null; // peers microphone / webcam
let remoteMediaControls = false; // enable - disable peers video player controls (default false)
let peerConnections = {}; // keep track of our peer connections, indexed by peer_id == socket.io id
