/**
 * Setup local audio - video devices
 */
function setupAudioVideoDevices() {
	// audio - video select box
	selectors = [audioInputSelect, audioOutputSelect, videoSelect];
	audioOutputSelect.disabled = !('sinkId' in HTMLMediaElement.prototype);
	navigator.mediaDevices.enumerateDevices().then(gotDevices).catch(handleError);
	audioInputSelect.addEventListener('change', (e) => {
		refreshLocalMedia();
	});
	audioOutputSelect.addEventListener('change', (e) => {
		changeAudioDestination();
	});
	videoSelect.addEventListener('change', (e) => {
		refreshLocalMedia();
	});
}

/**
 * Refresh Local media audio video in - out
 */
function refreshLocalMedia() {
	if (window.stream) {
		window.stream.getTracks().forEach((track) => {
			track.stop();
		});
	}
	const audioSource = audioInputSelect.value;
	const videoSource = videoSelect.value;
	const constraints = {
		audio: { deviceId: audioSource ? { exact: audioSource } : undefined },
		video: { deviceId: videoSource ? { exact: videoSource } : undefined },
	};
	navigator.mediaDevices.getUserMedia(constraints).then(gotStream).then(gotDevices).catch(handleError);
}

/**
 * Change Audio Output
 */
function changeAudioDestination() {
	const audioDestination = audioOutputSelect.value;
	attachSinkId(myVideo, audioDestination);
}

/**
 * Attach audio output device to video element using device/sink ID.
 * @param {*} element
 * @param {*} sinkId
 */
function attachSinkId(element, sinkId) {
	if (typeof element.sinkId !== 'undefined') {
		element
			.setSinkId(sinkId)
			.then(() => {
				console.log(`Success, audio output device attached: ${sinkId}`);
			})
			.catch((error) => {
				let errorMessage = error;
				if (error.name === 'SecurityError') {
					errorMessage = `You need to use HTTPS for selecting audio output device: ${error}`;
				}
				console.error(errorMessage);
				// Jump back to first output device in the list as it's the default.
				audioOutputSelect.selectedIndex = 0;
			});
	} else {
		console.warn('Browser does not support output device selection.');
	}
}

/**
 * Got Stream and append to local media
 * @param {*} stream
 */
function gotStream(stream) {
	// make stream available to console
	window.stream = stream;

	// refresh my video to peers
	for (let peer_id in peerConnections) {
		// https://developer.mozilla.org/en-US/docs/Web/API/RTCPeerConnection/getSenders
		let sender = peerConnections[peer_id].getSenders().find((s) => (s.track ? s.track.kind === 'video' : false));
		// https://developer.mozilla.org/en-US/docs/Web/API/RTCRtpSender/replaceTrack
		sender.replaceTrack(stream.getVideoTracks()[0]);
	}

	stream.getVideoTracks()[0].enabled = true;
	// https://developer.mozilla.org/en-US/docs/Web/API/MediaStream
	const newStream = new MediaStream([stream.getVideoTracks()[0], localMediaStream.getAudioTracks()[0]]);
	localMediaStream = newStream;

	// attachMediaStream is a part of the adapter.js library
	attachMediaStream(myVideo, localMediaStream);

	// Refresh button list in case labels have become available
	return navigator.mediaDevices.enumerateDevices();
}

/**
 * Get audio-video Devices and show it to select box
 * https://github.com/webrtc/samples/tree/gh-pages/src/content/devices/input-output
 * @param {*} deviceInfos
 */
function gotDevices(deviceInfos) {
	// Handles being called several times to update labels. Preserve values.
	const values = selectors.map((select) => select.value);
	selectors.forEach((select) => {
		while (select.firstChild) {
			select.removeChild(select.firstChild);
		}
	});
	// check devices
	for (let i = 0; i !== deviceInfos.length; ++i) {
		const deviceInfo = deviceInfos[i];
		// console.log("device-info ------> ", deviceInfo);
		const option = document.createElement('option');
		option.value = deviceInfo.deviceId;

		if (deviceInfo.kind === 'audioinput') {
			// audio Input
			option.text = deviceInfo.label || `microphone ${audioInputSelect.length + 1}`;
			audioInputSelect.appendChild(option);
		} else if (deviceInfo.kind === 'audiooutput') {
			// audio Output
			option.text = deviceInfo.label || `speaker ${audioOutputSelect.length + 1}`;
			audioOutputSelect.appendChild(option);
		} else if (deviceInfo.kind === 'videoinput') {
			// video Input
			option.text = deviceInfo.label || `camera ${videoSelect.length + 1}`;
			videoSelect.appendChild(option);
		} else {
			// something else
			console.log('Some other kind of source/device: ', deviceInfo);
		}
	} // end for devices

	selectors.forEach((select, selectorIndex) => {
		if (Array.prototype.slice.call(select.childNodes).some((n) => n.value === values[selectorIndex])) {
			select.value = values[selectorIndex];
		}
	});
}

/**
 * Extra function not used, print audio - video devices
 */
function getDevices() {
	// https://developer.mozilla.org/en-US/docs/Web/API/MediaDevices/enumerateDevices
	if (!navigator.mediaDevices || !navigator.mediaDevices.enumerateDevices) {
		console.log('enumerateDevices() not supported.');
		return;
	}
	// list cameras and microphones
	let myDevices = [];
	navigator.mediaDevices
		.enumerateDevices()
		.then(function (devices) {
			devices.forEach(function (device) {
				myDevices.push({
					deviceKind: device.kind,
					deviceName: device.label,
					deviceId: device.deviceId,
				});
			});
			console.log('Audio-Video-Devices', myDevices);
		})
		.catch(function (err) {
			console.log(err.name + ': ' + err.message);
		});
}

