function escapeSpecialChars(regex) {
	return regex.replace(/([()[{*+.$^\\|?])/g, '\\$1');
}
function appendMessage(name, img, side, text) {
	let ctext = detectUrl(text);
	const msgHTML = `
	<div class="msg ${side}-msg">
		<div class="msg-img" style="background-image: url(${img})"></div>
		<div class="msg-bubble">
		<div class="msg-info">
			<div class="msg-info-name">${name}</div>
			<div class="msg-info-time">${getFormatDate(new Date())}</div>
		</div>
		<div class="msg-text">${ctext}</div>
		</div>
	</div>
  `;
	msgerChat.insertAdjacentHTML('beforeend', msgHTML);
	msgerChat.scrollTop += 500;
}
function detectUrl(text) {
	let urlRegex = /(https?:\/\/[^\s]+)/g;
	return text.replace(urlRegex, function (url) {
		if (isImageURL(text)) {
			return '<p><img src="' + url + '" alt="img" width="200" height="auto"/></p>';
		}
		return '<a id="chat-msg-a" href="' + url + '" target="_blank">' + url + '</a>';
	});
}
function isImageURL(url) {
	return url.match(/\.(jpeg|jpg|gif|png)$/) != null;
}
function getFormatDate(date) {
	const h = '0' + date.getHours();
	const m = '0' + date.getMinutes();
	return `${h.slice(-2)}:${m.slice(-2)}`;
}
function emitMsg(name, msg) {
	if (msg) {
		signalingSocket.emit('msg', {
			peerConnections: peerConnections,
			name: name,
			msg: msg,
		});
		console.log('Send msg', {
			name: name,
			msg: msg,
		});
	}
}

